Fantasy DamselsFD - Oct 02, 2012 - Andrea Rosu


MP4 + Pics

Andrea's idea of a romantic evening would include lighting some candles, restraining herself and drifting off into her fantasies of being dominated. She straps herself tightly and then cuffs herself. Her genius lies in the fact that when her candle burns long enough, her handcuff keys shall fall allowing her to release herself. She's done it a thousand times and it always works like a charm. As usual it works again, only this time before she can release herself, her landlord shows up and she finds her in the most compromising of positions

